import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Tracker from './components/Tracker';
import StoredData from './pages/StoredData';

const App: React.FC = () => {
  const [days, setDays] = useState<any[]>([]);

  return (
    <Router>
      <nav style={{ margin: '1rem' }}>
        <Link to="/" style={{ marginRight: '1rem' }}>Tracker</Link>
        <Link to="/stored">Stored Data</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Tracker days={days} setDays={setDays} />} />
        <Route path="/stored" element={<StoredData days={days} />} />
      </Routes>
    </Router>
  );
};

export default App;
